import React, { Component } from 'react';
import './App.css';
import './components/Textbox.css';
import Login from './components/Login';
import User from "./components/User";
import Header from "./components/Layout/Header";
import ApplicationInfo from "./components/ApplicationInfo";
import Axios from "axios";
class App extends Component {
  state = {
    application: []
  };
  
  delApplication = id => {
    this.setState({
      application: [
        ...this.state.application.filter(application => application.id !== id)
      ]
    });
  };

  render() {
    return (
      
          <div className="App" id='background2'>
      <Login/>
        <div style={together}>
          <Header />
          <ApplicationInfo
            applicationInfo={this.state.application}
            delApplication={this.delApplication}
          />
        </div>
      </div>
    );
  }

render(){
  return(
      <div className= "user">
      <h1> users </h1>
      <form onSubmit={this.handleSubmit}>
      <label className= "userName">
        userName:
      <input
      type="text"
      name= "username"
      />
    </label>
    <label className= "Name">
        Name:
        <input
        type="text"
        name="name"
        />
    </label>
    <label className= "Email">
        Email:
        <input
        type="text"
        name="email"
        />
    </label>
    <label className= "Age">
        Age:
        <input
        type="number"
        name="age"
        />
    </label>
    <label className= "Password">
        RemainingPlaces:
        <input
        type="text"
        name="Password"
        />
    </label>
    <label className= "Phonenumber">
        Speakers:
        <input
        type="number"
        name="Phonenumber"
        />
    </label>
    <label className= "Usertype">
        Usertype:
        <input
        type="text"
        name="usertype"
        />
    </label>
    <button type = "submit"> Create user </button>
    </form>
   
    </div>
)
}
};



const together = {
  border: "10px",
  borderRadius: "10px",
  background: "#9D9FB9",
  margin: "auto",
  paddingBottom: "1px"
};

export default App;
